import {useEffect,useState} from "react";


function App(){
    const [name,setName]=useState("")
    const [email,setEmail]=useState("")
    const [pswd,setPswd]=useState("")
    const [repd,setRepd]=useState("")

    const onclick1=(j)=>{
       setName(j.target.value)
    }
     const onclick2=(j)=>{
       setEmail(j.target.value)
    }
     const onclick3=(j)=>{
       setPswd(j.target.value)
    }
     const onclick4=(j)=>{
       setRepd(j.target.value)
    }

    const onclicksubmit=()=>{
        if(name.length<=5){
            alert("must be enter < 6 charaters..!")
        }
        else if(pswd!=repd){
            alert("password dose not match")
        }
        else{
            alert("succesful")
        }
    }
    return(
        <div>
            <form onSubmit={onclicksubmit}>
                
                <input type="text" style={{paddiingTop:"20px",paddingBottom:"20px",paddingRight:"20px",paddingLeft:"20px"}}/>    <input type="submit"/> <br/><br/>
                <label>Name:</label><input type="text" placeholder="Enter your name "  required onChange={onclick1}/><br/><br/>
                <label>Email:</label><input type="email" placeholder="enter your email" required onChange={onclick2}/><br/><br/>
                <label>Password:</label><input type="password" placeholder="enter your password" required onChange={onclick3}/><br/><br/>
                <label>Re-Password:</label><input type="password" placeholder=" enter your Re Password" required onChange={onclick4}/><br/><br/>
                <input type="submit"/>
            </form>
        </div>
    )
}


export default App;
